import React from 'react';

// Icono DrWin en base64
// SVG de un robot moderno y profesional convertido a base64

export const DrWinIconBase64 = 'data:image/png;base64,';

// Componente React que renderiza el icono
export const DrWinIcon = ({ className = '', alt = 'Dr. Win AI Mentor' }) => {
  return (
    <img 
      src={DrWinIconBase64} 
      alt={alt} 
      className={className}
    />
  );
};

export default DrWinIcon;
